pragma solidity ^0.5.0;

contract AutonomousInspection {
    
    struct project {
        string name;
        mapping (int => string) inspectionItems;
        mapping (int => sheet) sheets;
        string wbs;
    }

    struct sheet {
        int[] itemsState; // 0: blank, 1: qualified, 2: defective, 3: corrected, 4: no this
        int executed; // times of inspection
        string executeTime; // the actual time of executing inspection
        address executor;
        int timing; // 0: planning time, 1: in constructing, 2: after constructing 
        string note;
        string photo;
        string contractor;
    }
    
    mapping (int => project) public projects;
    int public projectIndex = 0;

    function createSheet(int projectId, int sheetId, int[] memory _itemsState, int _timing, string memory _contractor) public {
        projects[projectId].sheets[sheetId] = sheet(_itemsState, 0, " ", address(1), _timing, " ", " ",  _contractor);
    }
    
    function fillSheet(int projectId, int sheetId, int[] memory _state, string memory _date, string memory _note, string memory _photo) public {
        projects[projectId].sheets[sheetId].itemsState = _state;
        projects[projectId].sheets[sheetId].executed ++;
        projects[projectId].sheets[sheetId].executeTime = _date;
        projects[projectId].sheets[sheetId].executor = msg.sender;
        projects[projectId].sheets[sheetId].note = _note;
        projects[projectId].sheets[sheetId].photo = _photo;
    }
    
    function inspectionItems(int projectId, int sheetId) public view returns(string memory _inspectionItems) {
        _inspectionItems = projects[projectId].inspectionItems[sheetId];
    }
    
    function sheetContent(int projectId, int sheetId) public view returns(int[] memory _itemsState, int _executed, string memory _executeTime, address _executor, int _timing, string memory _note, string memory _photo, string memory _contractor) {
        _itemsState = projects[projectId].sheets[sheetId].itemsState;
        _executed = projects[projectId].sheets[sheetId].executed;
        _executeTime = projects[projectId].sheets[sheetId].executeTime;
        _executor = projects[projectId].sheets[sheetId].executor;
        _timing = projects[projectId].sheets[sheetId].timing;
        _note = projects[projectId].sheets[sheetId].note;
        _photo = projects[projectId].sheets[sheetId].photo;
        _contractor = projects[projectId].sheets[sheetId].contractor;
    }

    function uploadItem(int projectId, int itemId, string memory ipfshash) public {
        projects[projectId].inspectionItems[itemId] = ipfshash;   
    }
    
    function wbs(int projectId, string memory ipfshash) public {
        projects[projectId].wbs = ipfshash;
    }

    function createProject(string memory _name, string memory ipfshash) public {
        projects[projectIndex].name = _name;
        projects[projectIndex].wbs = ipfshash;
        projectIndex ++;
    }
}
